using System;
using System.IO;
using System.Linq;
using ComponentAce.Compression.Libs.zlib;
using EFT;
using ServerLib.Network.Player;
using ServerLib.Utils.Reflection;
using UnityEngine;
using UnityEngine.Networking;
using Inventory = GClass1529;
using SetupInfo = GClass1652;

#pragma warning disable 618

namespace ServerLib.Network.Messages
{
    public class PlayerSpawnMessage : MessageBase
    {
        public override void Deserialize(NetworkReader reader)
        {
            // correct order for 9018
            ChanelId = reader.ReadByte();
            IsAlive = reader.ReadBoolean();
            Position = reader.ReadVector3();
            Rotation = reader.ReadQuaternion();
            IsInPronePose = reader.ReadBoolean();
            PoseLevel = reader.ReadSingle();

            //PlayerId = reader.ReadInt32();
            //ChanelIndex = reader.ReadByte();
            //SpawnPosition = reader.ReadVector3();
            //reader.ReadBytesAndSize();
            using (var memoryStream = new MemoryStream(reader.ReadBytesAndSize()))
            {
                using var binaryReader = new BinaryReader(memoryStream);
                Inventory = binaryReader.DeserializeInventory();
            }

            Profile = SimpleZlib.Decompress(reader.ReadBytesAndSize()).ParseJsonTo<Profile>();
            SearchableInfo = reader.DeSerializeSearchableInfo();

            IdGeneratorId = reader.ReadInt32();

            if (!IsAlive)
                return;

            reader.ReadBoolean();
            ScavExfilMask = reader.ReadInt32();
            HealthState = reader.ReadBytesAndSize();
            AnimationVariant = reader.ReadInt32();
            HandsEController = (EController) reader.ReadByte();

            switch (HandsEController)
            {
                case EController.None:
                    Debug.LogError("No hands controllers");
                    return;

                case EController.Empty:
                    break;

                case EController.Firearm:
                    IsInSpawnOperation = reader.ReadBoolean();
                    MisFireInfo.Deserialize(reader);
                    JamInfo.Deserialize(reader);
                    IsStationaryWeapon = reader.ReadBoolean();
                    ItemId = reader.ReadString();
                    break;

                case EController.Meds:
                    ItemId = reader.ReadString();
                    break;

                case EController.Grenade:
                    ItemId = reader.ReadString();
                    break;

                case EController.Knife:
                    ItemId = reader.ReadString();
                    break;

                case EController.QuickGrenade:
                    ItemId = reader.ReadString();
                    break;

                case EController.QuickKnife:
                    ItemId = reader.ReadString();
                    break;

                default:
                    throw new Exception("Invalid EController enum value:" + HandsEController);
            }

            _stringsCount = reader.ReadByte();
            SearchItemIds = new string[_stringsCount];

            for (int i = 0; i < (int) _stringsCount; i++)
            {
                SearchItemIds[i] = reader.ReadString();
            }
        }

        public override void Serialize(NetworkWriter writer)
        {
            writer.Write(PlayerId);
            writer.Write(ChanelId);
            writer.Write(Position);

            writer.Write(ChanelIndex);
            writer.Write(IsAlive);

            writer.Write(SpawnPosition);
            writer.Write(Rotation);
            writer.Write(IsInPronePose);
            writer.Write(PoseLevel);

            using (var memoryStream = new MemoryStream())
            {
                using var binaryWriter = new BinaryWriter(memoryStream);

                binaryWriter.SerializeInventory(Inventory);
                byte[] buff = memoryStream.ToArray();
                writer.WriteBytesAndSize(buff, buff.Length);
            }

            byte[] profileData = SimpleZlib.CompressToBytes(Profile.ToJson(), 9);
            writer.WriteBytesAndSize(profileData, profileData.Length);

            writer.SerializeSearchableInfo(SearchableInfo);
            writer.Write(IdGeneratorId);

            if (IsAlive)
            {
                // 0.12.4.6292 update, uses only in ObserverPlayer method CreatePhysical(), var EncumberDisabled
                writer.Write(EncumberDisabled);
                writer.Write(ScavExfilMask);
                writer.WriteBytesAndSize(HealthState, HealthState.Length);
                writer.Write(AnimationVariant);
                writer.Write((byte) HandsEController);

                switch (HandsEController)
                {
                    case EController.None:
                        Console.WriteLine("No hands controllers");
                        return;

                    case EController.Empty:
                        Console.WriteLine("Empty hands controllers");
                        break;

                    case EController.Firearm:
                        Console.WriteLine("Firearm hands controllers");
                        writer.Write(IsInSpawnOperation);
                        MisFireInfo.Serialize(writer);
                        JamInfo.Serialize(writer);

                        writer.Write(IsStationaryWeapon);
                        writer.Write(ItemId);
                        break;

                    case EController.Meds:
                        Console.WriteLine("Meds hands controllers");
                        writer.Write(ItemId);
                        break;

                    case EController.Grenade:
                        Console.WriteLine("Grenade hands controllers");
                        writer.Write(ItemId);
                        break;

                    case EController.Knife:
                        Console.WriteLine("Knife hands controllers");
                        writer.Write(ItemId);
                        break;

                    case EController.QuickGrenade:
                        Console.WriteLine("QuickGrenade hands controllers");
                        writer.Write(ItemId);
                        break;

                    case EController.QuickKnife:
                        Console.WriteLine("QuickKnife hands controllers");
                        writer.Write(ItemId);
                        break;

                    default:
                        throw new Exception("Invalid EController enum value:" + HandsEController);
                }

                writer.Write(_stringsCount);

                for (var i = 0; i < (int) _stringsCount; i++)
                {
                    writer.Write(SearchItemIds[i]);
                }
            }

            base.Serialize(writer);
        }

        public static PlayerSpawnMessage FromProfile(int chanel, Profile profile)
        {
            PlayerSpawnMessage spawnMessage = GetPlayerSpawnMessage();

            spawnMessage.PlayerId = chanel;
            spawnMessage.ChanelId = (byte) chanel;
            spawnMessage.ChanelIndex = (byte) chanel;

            spawnMessage.Profile = profile.Clone();
            spawnMessage.Profile.AccountId = profile.AccountId;
            spawnMessage.Profile.PetId = profile.PetId;
            spawnMessage.Profile.Id = profile.Id;

            spawnMessage.Profile.Inventory = default;
            spawnMessage.Inventory = profile.Inventory;

            spawnMessage.HandsEController = EController.Empty;
            spawnMessage.SearchableInfo = GClass803.ExtractSearchInfo(spawnMessage.Inventory.AllPlayerItems).ToArray();
            //spawnMessage.Position = SpawnUtils.GetRandomSpawnPoint().Position;
            //spawnMessage.SpawnPosition = spawnMessage.Position;
            spawnMessage.IsAlive = true;

            return spawnMessage;
        }

        public static PlayerSpawnMessage FromInstance(EFT.Player player, int chanel)
        {
            PlayerSpawnMessage spawnMessage = GetPlayerSpawnMessage();
            var profile = player.Profile;

            spawnMessage.PlayerId = chanel;
            spawnMessage.ChanelId = (byte) chanel;
            spawnMessage.ChanelIndex = (byte) chanel;

            spawnMessage.Profile = profile.Clone();

            spawnMessage.Profile.Inventory = default;
            spawnMessage.Inventory = profile.Inventory;
            spawnMessage.SearchableInfo = GClass803.ExtractSearchInfo(profile.Inventory.NonQuestItems).ToArray();
            spawnMessage.Position = player.Transform.position;
            spawnMessage.SpawnPosition = player.Transform.position;
            spawnMessage.Rotation = player.Transform.rotation;
            spawnMessage.PoseLevel = player.MovementContext.PoseLevel;
            spawnMessage.IsInPronePose = player.MovementContext.IsInPronePose;
            spawnMessage.IsInSpawnOperation = false;
            spawnMessage.AnimationVariant = player.CurrentAnimatorStateIndex;
            spawnMessage.EncumberDisabled = player.Physical.EncumberDisabled;

            (string item, EController controller) = player.HandsController.GetHandsControllerType();
            spawnMessage.HandsEController = controller;
            spawnMessage.ItemId = item;
            if (controller == EController.Firearm)
            {
                var firearmController = player.HandsController as EFT.Player.FirearmController;
                if (firearmController != null)
                {
                    spawnMessage.JamInfo = firearmController.GetJamRandomsSetupInfo();
                    spawnMessage.MisFireInfo = firearmController.GetMisfireRandomsSetupInfo();
                }
            }
            Console.WriteLine(player.Profile.Info.Nickname + ": " + controller.ToString());
            spawnMessage.IsAlive = player.HealthController.IsAlive;

            var previousHealthState = spawnMessage.HealthState;
            spawnMessage.HealthState = (player.HealthController as GClass1263)?.SerializeState();
            if (spawnMessage.HealthState == null)
                spawnMessage.HealthState = (player.HealthController as GClass1264)?.SerializeState(); // this is one above the one 1263 from 2 lines above
            if (spawnMessage.HealthState == null)
                spawnMessage.HealthState = previousHealthState;
            return spawnMessage;
        }

        public static PlayerSpawnMessage GetPlayerSpawnMessage()
        {
            string base64 =
                "";
            byte[] data = Convert.FromBase64String(base64);
            var reader = new NetworkReader(data);
            return reader.ReadMessage<PlayerSpawnMessage>();
        }

        public int PlayerId;
        public byte ChanelId;
        public byte ChanelIndex;
        public Vector3 Position = new Vector3(57.9f, 0.06f, 21.998f);
        public Vector3 SpawnPosition = new Vector3(57.9f, 0.1f, 22.0f);
        public Quaternion Rotation = new Quaternion(0.0f, 0.5f, 0.0f, 0.9f);
        public bool IsInPronePose;
        public float PoseLevel = 1f;
        public int AnimationVariant;
        public Profile Profile = new Profile();
        public Inventory Inventory = new Inventory();
        public GClass804[] SearchableInfo = new GClass804[0];
        public int IdGeneratorId;
        public int ScavExfilMask;
        public byte[] HealthState = new byte[0];
        public bool IsAlive = true;
        public EController HandsEController = EController.Empty;
        public bool IsInSpawnOperation;
        public SetupInfo MisFireInfo;
        public SetupInfo JamInfo;
        public bool IsStationaryWeapon;
        public string ItemId;
        public bool EncumberDisabled; // true for bots

        /* NOT USED */
        private byte _stringsCount;
        public string[] SearchItemIds = new string[0];

        public const short MessageId = 155;
    }
}
